package com.syntax.class09;

public class NestedLoopCar {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		//How can i print car adometr
		
	
		for(int a=0; a<3; a++) {
			for(int b=0; b<3; b++) {
				for(int c=0; c<3; c++) {
					for(int d=0; d<3; d++) {
						for(int e=0; e<3; e++) {
							
							System.out.println(a+""+b+""+c+""+d+""+e+"");
						}
					}
				}
			}
		}
		
		
		
		
		
		
		
		
		
		
		
		
		
	}

}
